  `status` tinyint(1) NOT NULL DEFAULT 0 COMMENT '流程状态:0-进行中;1-已完成;2-已驳回;3-已撤销;',
  `def_key` varchar(128) NOT NULL COMMENT '流程(act_re_procdef表)key',
  `apply_time` datetime NOT NULL COMMENT '申请时间',
  `create_time` datetime NOT NULL DEFAULT current_timestamp() COMMENT '创建时间',
  `update_time` datetime NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=35 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='事项申请表';

